import { createTheme } from "@mui/material";
import { neutral } from "./colors";

const customtheme = createTheme({
    status:{
        danger: neutral[500],
    },

    palette: {
        primary: {
          light: '#757ce8',
          main: '#3f50b5',
          dark: '#002884',
          contrastText: '#fff',
        },
        secondary: {
          light: '#ff7961',
          main: '#f44336',
          dark: '#ba000d',
          contrastText: '#000',
        },
      },
})

export default customtheme;
